import SpecialCard from "./SpecialCard"

function SpecialCardList({ specials }) {
    return (
        <>
        <h1>card list</h1>
        {specials.map(special => {
        return <SpecialCard key={special.id} special={special}/>
        })}
        </>
    )
}

export default SpecialCardList
